import React from "react";
import ToolBar from "@mui/material/Toolbar";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Button from "@mui/material/Button";

import { makeStyles } from "@mui/styles";
import { styled } from "@mui/material/styles";
import theme from "./theme";

// import Typography from "@mui/material/Typography";

// creative components
import logo from "../../assets/logo.svg";

// Styling
const useStyles = makeStyles(() => ({
  logo: {
    height: "5em",
  },
  tabsContainer: {
    marginLeft: "auto",
    color: "white",
  },
}));

// Styling the tab, need to create a
const StyledTab = styled(Tab)(() => ({
  ...theme.typography.tab,
  minWidth: 10,
  marginLeft: "25px",
}));

const StyledButton = styled(Button)(() => ({
  borderRadius: "50px",
  paddingLeft: "50px",
  paddingRight: "25px",
}));

const ToolBarCom: React.FC = () => {
  const classes = useStyles();

  return (
    <ToolBar disableGutters>
      {/* <Typography variant='h3'>Arc Development</Typography> */}
      <img src={logo} alt='company logo' className={classes.logo} />
      <Tabs className={classes.tabsContainer}>
        <StyledTab label='Home' />
        <StyledTab label='Services' />
        <StyledTab label=' The Revolution' />
        <StyledTab label='About Us' />
        <StyledTab label=' Contact Us' />
      </Tabs>
      <StyledButton variant='contained' color='secondary'>
        Free Trial
      </StyledButton>
    </ToolBar>
  );
};

export default ToolBarCom;
